import React from 'react'

function SubCategory(props) {
    return (
        <div className='subCategoryRoot'>
            <div className='subCategoryName'>
                <p> {props.SubCategoryName} </p>
            </div>
            <div className='categoryItem'>
                {props.CategoryItemArray.map(CategoryItem => (
                    <div className='album' 
                        key={CategoryItem.id}
                    >
                        <img src={CategoryItem.CoverImage} />
                        <div className='categoryItemName'>  
                            <p> {CategoryItem.name} </p>
                        </div> 
                    </div>  
                ))}
            </div>
        </div>
    )
}

export default SubCategory
